import styled from "styled-components";

export const StyledLogoutButton = styled.button`
  background-color: orange;
  border-radius: 5px;
  width: 8vw;
  height: 40px;
  align-self: flex-end;
  margin-right: 3px;
  margin-bottom: 5px;
`;
